import React from 'react';
import { projects } from '../../data';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faExternalLinkAlt } from '@fortawesome/free-solid-svg-icons';
import activity from '../../Images/activities.png';
import signup from '../../Images/signup.png';
import detailed from '../../Images/detailed.png';
import dahsboard from '../../Images/dashboard.png';

const Projects = () => {
    console.log(projects)
    return (
        <div style={{ height: '300vh'}}>
            <div>
                {projects.map(project => (
                    <div key={project.name} style={{backgroundColor: '#F4F4F4', margin: '1rem 1.5rem', height: '90vh', borderRadius: '.5rem', display: 'flex', flexWrap: 'wrap' , border: "black solid 2px", color: '#51595F'}}>
                        <section style={{width: '57vw', border: "black solid 2px", display: 'flex', flexDirection: 'column', alignItems: 'flex-start', padding:'2rem' ,height: '100%'}}>
                            <h2>{project.name}</h2>
                            <div>{project.subtitle}</div>
                            <section style={{display: 'flex', height: '55%', padding: '2rem 0rem'}}>
                                <img src={dashboard} className='images' style={{width: '70%', borderRadius: '.3rem'}}/>
                                <div style={{display: 'flex', flexDirection: 'column', margin: '0rem 1rem', justifyContent: 'space-between'}}>
                                    <img src={activity} className='images' style={{width: '100%', height: '30%', borderRadius: '.3rem' }}/>
                                    <img src={signup} className='images' style={{width: '100%', height: '30%', borderRadius: '.3rem' }}/>
                                    <img src={detailed} className='images' style={{width: '100%', height: '30%', borderRadius: '.3rem' }}/>
                                </div>
                            </section>
                        </section>
                        <section style={{width: '30vw', border: "black solid 2px", padding:'2rem 1rem'}}>
                            { project.name === 'MySchool' ?
                            <h2 style={{ display: 'flex', height: '3%', paddingBottom: '1.8rem'}}>
                                <div className='logo' style={{backgroundColor: '#F4F4F4', width: '10%'}}></div>
                                <div style={{backgroundColor: '#2A4365', width: '40.9%'}} className='logo'></div>
                                <div style={{backgroundColor: '#FFBB00', width: '14.7%'}} className='logo'></div>
                                <div style={{backgroundColor: '#FB6542', width: '14.7%'}} className='logo'></div>
                                <div style={{backgroundColor: '#375E97', width: '15%'}}className='logo'></div>
                            </h2>
                            :
                            ''
                            }
                            <p style={{paddingTop: '3rem', textAlign: 'left'}}>{project.description}</p>
                            <div style={{display: 'flex'}}>
                                <div style={{borderRadius: '.3rem', width: '10vw' ,border: '1px solid #004DC0', margin:'2rem 1rem 0rem 0rem', padding: '.3rem 0rem'}}><a style={{color: '#004DC0', textDecoration: 'none'}} href={project.URL}><FontAwesomeIcon icon={faExternalLinkAlt}/> Visit Directly</a></div>
                                <div style={{backgroundColor: '#004DC0', borderRadius: '.3rem', width: '7vw', margin:'2rem 1rem 0rem 0rem', padding: '.3rem 0rem'}}><a style={{color: 'white', textDecoration: 'none'}} href={project.URL}>Read More</a></div>
                            </div>
                        </section>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Projects;
